import React, { useState, useEffect } from 'react';
import axios from 'axios';

const Followers = () => {
    const [followers, setFollowers] = useState([]);

    useEffect(() => {
        axios.get('/currentUser/followers', { withCredentials: true })
            .then(response => {
                setFollowers(response.data);
            })
            .catch(error => {
                console.error('Error fetching followers:', error);
            });
    }, []);

    return (
        <div>
            <h2>Followers</h2>
            <ul>
                {followers.map(follow => (
                    <li key={follow.follower._id}>{follow.follower.name}</li> // Assuming the follower user object has an _id and name
                ))}
            </ul>
        </div>
    );
};

export default Followers;
